import {BrowserRouter as Router,Route,Routes} from"react-router-dom";
import logo from './logo.svg';
import './App.css';
import Home from "./Component/Home";
import About from "./Component/About"
import Contact from "./Component/Contact"
import Service from "./Component/Service"
import Feature from "./Component/Feature"
import Admin from "./Admin/Admin"
import User from "./Component/User"
import Register from "./Component/Register"
import Dashboard from "./Admin/Dashboard"
import Master from "./Master";
import AddParking from "./Parking/AddParking";
import AddCity from "./Parking/AddCity";
import ViewCity from "./Parking/ViewCity";
import AddSlots from "./Parking/AddSlots";


function App(){
  return (
    <>
    <Router>
      <Routes>
        <Route path="/" element={<Master/>}>
        <Route path="/" element={<Home/>}/>
        <Route path="/about" element={<About/>}/>
        <Route path="/contact" element={<Contact/>}/>
        <Route path="/feature" element={<Feature/>}/>
        <Route path="/service" element={<Service/>}/>
        <Route path="/admin" element={<Admin/>}/>
        <Route path="/user" element={<User/>}/>
        <Route path="/register" element={<Register/>}/>
        </Route>


        <Route path="/dashboard" element={<Dashboard/>}>
        <Route path="/dashboard/addParking" element={<AddParking/>}/>
        <Route path="/dashboard/addCity" element={<AddCity/>}/>
        <Route path="/dashboard/viewCity" element={<ViewCity/>}/>
        <Route path="/dashboard/addSlots" element={<AddSlots/>}/>
        <Route path="/dashboard/addSlots" element={<AddSlots/>}/>



        </Route>


      </Routes>
    </Router>

    </>
  )

}



export default App;
